import React, { useState } from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Menu from "@mui/material/Menu";
import Container from "@mui/material/Container";
import Button from "@mui/material/Button";
import MenuItem from "@mui/material/MenuItem";
import { TextField } from "@mui/material";
import PermIdentityIcon from "@mui/icons-material/PermIdentity";
import LocalMallOutlinedIcon from "@mui/icons-material/LocalMallOutlined";
import FavoriteBorderOutlinedIcon from "@mui/icons-material/FavoriteBorderOutlined";
import { withRouter } from "react-router-dom";

const settings = ["Profile", "Account", "Dashboard", "Logout"];

const Navigation = (props) => {
  const [anchorElUser, setAnchorElUser] = useState(null);
  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  return (
    <AppBar
      position="sticky"
      variant="elevation"
      color="inherit"
      className="sm:p-3"
    >
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ mr: 2, display: { xs: "none", md: "flex" } }}
            onClick={() => {
              props.history.push("/");
            }}
          >
            <img
              className="h-8 sm:h-12"
              src="data:image/jpeg;base64,"
              alt="logo"
            />
          </Typography>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ flexGrow: 1, display: { xs: "flex", md: "none" } }}
          >
            <img
              className="h-8 sm:h-12"
              src="data:image/jpeg;base64,"
              alt="logo"
            />
          </Typography>
          <Box sx={{ flexGrow: 1, display: "flex" }}>
            <Button
              onClick={() => {
                props.history.push("/men");
              }}
              sx={{
                my: 2,
                color: "black",
                marginLeft: "10px",
                display: "block",
                fontSize: { xs: "14px", sm: "15px" },
                fontWeight:"bold",
                paddingRight: { xs: "5px", sm: "40px" },
              }}
            >
              MEN
            </Button>

            <Button
              onClick={() => {
                props.history.push("/women");
              }}
              sx={{
                my: 2,
                color: "black",
                display: "block",
                fontSize: { xs: "14px", sm: "15px" },
                fontWeight:"bold",
                paddingRight: { xs: "5px", sm: "20px" },
              }}
            >
              WOMEN
            </Button>
            <Button
              onClick={() => {
                props.history.push("/kids");
              }}
              sx={{
                my: 2,
                color: "black",
                display: "block",
                fontSize: { xs: "14px", sm: "15px" },
                fontWeight:"bold",
                paddingRight: { xs: "5px", sm: "20px" },
              }}
            >
              KIDS
            </Button>
            <Button
              onClick={() => {
                props.history.push("/homeandliving");
              }}
              sx={{
                my: 2,
                color: "black",
                display: "block",
                fontSize: { xs: "14px", sm: "15px" },
                fontWeight:"bold",
                paddingRight: { xs: "5px", sm: "20px" },
              }}
            >
              HOME & LIVING
            </Button>
          </Box>

          <Box sx={{ flexGrow: 0 }} className="d-fixed hidden lg:flex">
            <TextField
              style={{ marginTop: "10px" }}
              id="outlined-basic"
              label="Search"
              size="small"
              variant="outlined"
            />
            <div
              style={{
                display: "inline-block",
                textAlign: "center",
                marginLeft: "20px",
              }}
              onClick={() => {
                props.history.push("/login");
              }}
            >
              <PermIdentityIcon
                className="m-auto cursor-pointer"
                style={{ marginLeft: "30px", fontSize: "20px" }}
              />
              <p>Profile</p>
            </div>

            <div
              style={{
                display: "inline-block",
                textAlign: "center",
                marginLeft: "20px",
              }}
              onClick={() => {
                props.history.push("/wishlist");
              }}
            >
              <FavoriteBorderOutlinedIcon
                className="m-auto cursor-pointer"
                style={{ marginLeft: "30px", fontSize: "20px" }}
              />
              <p>Wishlist</p>
            </div>

            <div
              style={{
                display: "inline-block",
                textAlign: "center",
                marginLeft: "20px",
              }}
            >
              <LocalMallOutlinedIcon
                className="m-auto cursor-pointer"
                style={{ marginLeft: "30px", fontSize: "20px" }}
              />
              <p>Bag</p>
            </div>

            <Menu
              sx={{ mt: "45px" }}
              id="menu-appbar"
              anchorEl={anchorElUser}
              anchorOrigin={{
                vertical: "top",
                horizontal: "right",
              }}
              keepMounted
              transformOrigin={{
                vertical: "top",
                horizontal: "right",
              }}
              open={Boolean(anchorElUser)}
              onClose={handleCloseUserMenu}
            >
              {settings.map((setting) => (
                <MenuItem key={setting} onClick={handleCloseUserMenu}>
                  <Typography textAlign="center">{setting}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};
export default withRouter(Navigation);
